    false,nt"url": null,nt"notes": "LiDAR was collected at a 1.4 points per
    square meter (1.4m GSD) for 359 square miles in northwestern Vermont. The geoid
    used to reduce satellite derived elevations to orthometric heights was Geoid 03.
    Nominal pulse density is 77,100 Hz. GPS coordinates are referenced to NAD83 Vermont
    State Plane Coordinate System. Maximum differential baseline lengths is 33 miles.
    Mean differential baseline lengths is 15 miles. Laser bore site calibration is the
    process whereby the angular misalignment between the IMU and the laser is determined.
    The components determined are roll, pitch and heading. These are rotations around
    the X, Y and Z-axis respectively. For more detailed information about calibration
    procedures, please see the project report.",nt"owner_org": "0c3a4ebc-9929-4f21-bdd0-76a35d52f57d",nt"extras":
